import React, { PureComponent } from 'react';
import '../assets/css/Dashboard.css';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
  Label,
} from 'recharts';


class LineGraphCard extends PureComponent {

  render() {

    const { graphData } = this.props;

    return (

      <div className="card-big-container">
        <div className="card-title"> Follower Region Distribution </div>
        <ResponsiveContainer width={290} height="75%" className="chart-container">
          <LineChart data={graphData} margin={{top: 5, bottom: 5, left: -30}}>
            <XAxis dataKey="time"/>
            <YAxis/>
            <Line type="monotone" dataKey="score" stroke="#8884d8" activeDot={{r: 8}}/>
            <Tooltip/>
         </LineChart>
       </ResponsiveContainer>
      </div>
    )

  }

}



export default LineGraphCard;
